class Footer extends Component{
    render(){
        return(
            <>
            <hr />
            <h3>Contact</h3>
            <b>Mob</b><p>345678976543</p>
            <b>Email:</b>
            <p>v@gmail.com</p>
            </>
        );
    };
}
export default Footer;
